import React from "react";
import { Link } from "react-router-dom";

const Sidebar = () => (
  <div style={{
    width: 200,
    height: "100vh",
    background: "#f0f0f0",
    padding: 24,
    boxSizing: "border-box",
    position: "fixed",
    left: 0,
    top: 0
  }}>
    <h3>WB Monitoring</h3>
    <nav>
      <ul style={{ listStyle: "none", padding: 0 }}>
        <li>
          <Link to="/ffbreupload">FFB Reupload</Link>
        </li>
        {/* Add more links here */}
      </ul>
    </nav>
  </div>
);

export default Sidebar;
